import React from "react";
import {Field, reduxForm} from "redux-form";
import {required} from "../../validator";
import {FormComponent} from "../common/FormControl/FormsControl";

const LoginPage = () =>{
    const onSubmit = () => {}
    return<>
    <h1>Login</h1>
        <LoginReduxForm onSubmit={onSubmit}/>
    </>
}
const LoginForm = (props) =>{
    return<>
        <form onSubmit={props.handleSubmit}>
            <div>
                <Field component={FormComponent("input")} validate={[required]} name="login" placeholder="Login"/>
            </div>
            <div>
                <Field component={FormComponent("input")} validate={[required]} name="password" placeholder="Password"/>
            </div>
            <div>
                <Field component="input" name="rememberMe" type="checkbox"/><span>Remember me</span>
            </div>
            <div>
                <button>Sign in</button>
            </div>
        </form>
    </>
}
const LoginReduxForm = reduxForm({form:'login'})(LoginForm)
export default LoginPage
